BEGIN TRANSACTION;
CREATE TABLE "Video" (
	`Video_ID`	TEXT NOT NULL UNIQUE,
	`Owner_User_ID`	TEXT NOT NULL,
	`View_Count`	INTEGER NOT NULL,
	`Upload_Date`	TEXT NOT NULL,
	`Title`	TEXT NOT NULL,
	`Artist`	TEXT NOT NULL,
	`Type`	TEXT NOT NULL,
	`State`	TEXT NOT NULL,
	PRIMARY KEY(Video_ID),
	FOREIGN KEY(`Owner_User_ID`) REFERENCES User_Profile(User_ID)
);
CREATE TABLE "User_Profile" (
	`User_ID`	TEXT NOT NULL UNIQUE,
	`First_name`	TEXT NOT NULL,
	`Last_name`	TEXT NOT NULL,
	`Gender`	TEXT NOT NULL,
	`DoB`	TEXT NOT NULL,
	`Email`	TEXT NOT NULL,
	`Date_Membered`	TEXT NOT NULL,
	`Last_Date_Accessed`	TEXT NOT NULL,
	PRIMARY KEY(User_ID)
);
CREATE TABLE "Friend_List" (
	`User_ID`	TEXT NOT NULL,
	`Searched_Friend_Email`	TEXT NOT NULL,
	`Friend_Registered`	TEXT NOT NULL,
	`Friend_Agreed`	TEXT NOT NULL,
	`Friend_ID`	TEXT NOT NULL,
	`Friend_Group`	TEXT NOT NULL,
      PRIMARY KEY(User_ID,Friend_ID,Friend_Group),
      FOREIGN KEY(`User_ID`) REFERENCES User_Profile(User_ID),
      FOREIGN KEY(`Friend_ID`) REFERENCES User_Profile(User_ID),
      FOREIGN KEY(`Friend_Group`) REFERENCES Friend_Group(Friend_Group)




);
CREATE TABLE "Friend_Group" (
	`User_ID`	TEXT NOT NULL,
	`Friend_Group`	TEXT NOT NULL,
	`Granted_Personal_Info`	TEXT NOT NULL,
	`Granted_Channels`	TEXT NOT NULL,
      PRIMARY KEY(User_ID,Friend_Group),
      FOREIGN KEY(`User_ID`) REFERENCES User_Profile(User_ID)
      
      
);
CREATE TABLE "Channels" (
	`Owner_ID`	TEXT NOT NULL,
	`Channel_ID`	TEXT NOT NULL UNIQUE,
	`Channel_Type`	TEXT NOT NULL,
	`Video_IDs`	TEXT NOT NULL,
	`Date_Created`	TEXT NOT NULL,
	PRIMARY KEY(Channel_ID),
	FOREIGN KEY(`Owner_ID`) REFERENCES User_Profile(User_ID)
);
COMMIT;
